import React from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { selectTotalScore } from "../../redux/progress/selectors";

import "./styles.scss";

const ProfilePage = () => {
  const totalScore = useSelector(selectTotalScore);

  return (
    <div className="user-profile-page">
      <div className="first-name">First name: {}</div>
        <div className="second-name">Second name: </div>
        <div className="email">Email: </div>
        <div className="total-score">Total score in previus </div>
      <hr className="area" />
      <Link
        to="/"
      >
        <button className="button-return">Вернуться на главную страницу</button>
      </Link>
    </div>
  );
};

export default ProfilePage;
